export default class Formatter {
    /* eslint-disable-next-line class-methods-use-this */
    format(value) {
        return value;
    }

    /* eslint-disable-next-line class-methods-use-this */
    parse(value) {
        return value;
    }

    /* eslint-disable-next-line class-methods-use-this */
    validate() {
        return {
            valid: false,
        };
    }
}
